This program prints the standard path to a home directory on various operating systems if "zach" is your username. // Home.java
void main() { IO.println(" Linux: /home/zach"); IO.println(" Mac: /Users/zach"); IO.println("Windows: /c/Users/zach"); IO.println(" or C:\\Users\\zach");
}
// We'll talk about why "\\" prints as "\" later What if we want to change the username? How to create a variable var keyword (only for this week) Identifier (variable name) Initial value How to reassign variable Modify Home.java to use a variable Add a second user What if we wanted it to work for the whole class?

